teachers=Jan Stallings, Linda Gordon;skill_754=1;skill_755=2;skill_756=2;skill_757=1;skill_758=1;skill_759=2;skill_760=2;skillspost=754,755,756,757,758,759,760,761,762,763,764,765,766,767,768,769,770;skill_761=2;skill_762=2;skill_763=2;skill_764=2;skill_765=2;skill_766=2;skill_767=2;skill_768=2;skill_769=2;skill_770=2;comments=<p>Grace is very focused in social studies. &nbsp;She is always prepared and ready to face any challenge. &nbsp;Grace's knowledge about key events and people in history is impressive. She is not usually the first one in class to volunteer, but she often lends support to others during class discussions. &nbsp;Her life skills are impeccable. When Grace shares she is very respectful, responsible and organized. &nbsp;She has good problem solving skills and is never afraid to express them. &nbsp;Grace was a strong leader in her explorer simulation group. &nbsp;While this was a position she did not seemed too excited about doing, she learned to manage her group successfully. &nbsp;The more important learning arose from the fact that Grace discovered that she could be a leader and offer viable support to her classmates. She had to make difficult decisions about what information she should use and what should be discarded. &nbsp;Grace did an excellent job on her explorer book about Juan Ponce de Leon.&nbsp;</p>
<p>&nbsp;</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=1;submit=Save Section;

