teachers=Stefanie Grutman, Jessica Collins, and Molly Kirkpatrick;skill_1083=2;skillspost=1083,1084,1085,1086,1087,1088,1089,1090,1091,1092,1093,1094,1095,1096,1097,1098,1099,1100,1101,1102,1103,1104,1105,1106,1107,1108,1109,1110,1111,1112,1113,1114,1115;skill_1084=2;skill_1085=4;skill_1086=4;skill_1087=4;skill_1088=4;skill_1089=4;skill_1090=2;skill_1091=2;skill_1092=4;skill_1093=2;skill_1094=4;skill_1095=2;skill_1096=10;skill_1097=4;skill_1098=4;skill_1099=4;skill_1100=4;skill_1101=4;skill_1102=2;skill_1103=4;skill_1104=2;skill_1105=4;skill_1106=4;skill_1107=4;skill_1108=2;skill_1109=4;skill_1110=4;skill_1111=5;skill_1112=5;skill_1113=2;skill_1114=2;skill_1115=2;comments=<p>It seems that Ariyah has difficulty organizing her thinking to give information or retell information in sequential order and in a cohesive manner.</p>
<p>We have seen some growth in Ariyah's reading. Her fluency has improved, however, she still tends to gloss over words that she doesn't know, and in its place, substitute a word that does not fit the context of the story. When reading with Ariyah, we use a variety of strategies to help her decode the unknown word, and therefore, comprehend what she's reading.</p>
<p>Ariyah's written language also has some of the same confusion as does her expressive language. Through writing conferences, we are helping Ariyah to organize her ideas using a webs and word list to clarify her thinking.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Stefanie Grutman, Jessica Collins, and Molly Kirkpatrick;skill_1083=2;skillspost=1083,1084,1085,1086,1087,1088,1089,1090,1091,1092,1093,1094,1095,1096,1097,1098,1099,1100,1101,1102,1103,1104,1105,1106,1107,1108,1109,1110,1111,1112,1113,1114,1115;skill_1084=2;skill_1085=4;skill_1086=4;skill_1087=4;skill_1088=4;skill_1089=4;skill_1090=2;skill_1091=2;skill_1092=4;skill_1093=2;skill_1094=4;skill_1095=2;skill_1096=10;skill_1097=4;skill_1098=4;skill_1099=4;skill_1100=4;skill_1101=4;skill_1102=2;skill_1103=4;skill_1104=2;skill_1105=4;skill_1106=4;skill_1107=4;skill_1108=2;skill_1109=4;skill_1110=4;skill_1111=5;skill_1112=5;skill_1113=2;skill_1114=2;skill_1115=2;comments=<p>It seems that Ariyah has difficulty organizing her thinking to give information or retell information in sequential order and in a cohesive manner.</p>
<p>We have seen some growth in Ariyah's reading. Her fluency has improved, however, she still tends to gloss over words that she doesn't know, and in its place, substitute a word that does not fit the context of the story. When reading with Ariyah, we use a variety of strategies to help her decode the unknown word, and therefore, comprehend what she's reading.</p>
<p>Ariyah's written language also has some of the same confusion as does her expressive language. Through writing conferences, we are helping Ariyah to organize her ideas using a webs and word list to clarify her thinking.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

