<p>&nbsp;</p>;reader_notes=;notes=;status=1;submit=Save Section;

teachers=Catalina Hernandez;skill_703=2;skill_704=2;skillspost=703,704,713,714,715,716,717,718;skill_713=2;skill_714=2;skill_715=2;skill_716=2;skill_717=2;skill_718=2;comments=<p>Sometimes Neil has difficulty staying focused on tasks and class activities.&nbsp; When he participates appropriately, he demonstrates excellent expression, pronunciation, etc.&nbsp;</p>
<p>He&nbsp;is always willing to help other friends with Spanish words.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=1;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Alex is a kind and caring friend to her peers. At various times Alex will particpate in our group discussions. When Alex does participate she speaks in a small voice. She is working on projecting her voice so her thoughts, comments, and ideas are heard by all. As a class, we are strengthening our speaking skills by askin and answerings questions using complete sentences.&nbsp;</p>
<p>Alex can be distracted by her friends through private conversations, but with teacher reminders she is able to redirtect her attention to the task at hand and complete her work in a timely manner.</p>
<p>Alex is a responsible work team participant. She completes her work team responsibilities and will often offer to help others with their jobs. Alex will take the initiative and do the work of a friend who is absent.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Chloe is a kind and caring friend, and shows a sincere and earnest desire to do well and follow the classroom routines. &nbsp;She participates during our group discussions, but at times we need to remind her to project her voice. &nbsp;Chloe is more than willing to help others and she is very responsible in focusing on her work and completing it on time.</p>
<p>We are continuing to find ways to help Chloe expand her circle of friends through mixed groups such as Fun Fridays, math groups, field trip groups, and seat arrangements in class and in the Specialist's classrooms.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Derin is a very social boy who loves conversation. Derin freely participates during our group discussions and cheerfully shares about his family adventures, news, or discoveries.&nbsp;Derin is working on respectfully waiting his turn to talk and not distracting others from their work.</p>
<p>Derin has a lot of energy and at times he needs to stand up and walk around for a minute or two to help him refocus.&nbsp;</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Ethan has a great sense of humor and he is a person who thinks outside of the box. He is a good friend to his peers and he is always willing to help either his teachers or his peers. There are times when Ethan needs to be reminded to not chat, but he is easily redirected by his teachers.&nbsp;</p>
<p>Ethan participates during our group discussions and he is working on making comments and asking and answering questions using complete sentences during our morning shares.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Jasmine is beginning to blossom in the classroom. She is starting to participate more during our group discussions though we do need to remind her to project her voice so everyone can hear what she has to say.</p>
<p>Jasmine is a sensitive, kind and caring friend. She loves to chat with her peers and share stories about her animals at home.&nbsp;</p>
<p>We continue to help Jasmine stay focused during instructions, group discussions and morning shares.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Catalina Hernandez;skill_703=2;skill_704=2;skillspost=703,704,713,714,715,716,717,718;skill_713=2;skill_714=2;skill_715=2;skill_716=2;skill_717=2;skill_718=2;comments=<p>Lucinda&nbsp;always gives her full attention and is eager to participate in class activities. &nbsp;She displays excellent ethic habits puting her personal best effort in her work.</p>
<p>It is a pleasure to have her in class.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=1;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Kian is an energetic boy who has so much to say about the world. He a kind and caring friend with a heart of gold.&nbsp;</p>
<p>Kian has difficulty listening and following directions whether it be written or verbal directions. We are trying to help Kian regulate himself so he can tell us what he needs to be doing instead of always telling him what he needs to do.&nbsp;</p>
<p>Kian wants to do well, but there is a disconnect and we are trying to help him find strategies to listen, understand, and follow through with class work, responsibilities and focus.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Linus is a kind, caring and friendly boy. He is respectful to both his teachers and peers.</p>
<p>Linus participates during our group discussions and he is working on making comments, asking questions and answering questions using complete sentences.&nbsp;</p>
<p>We are helping Linus expand his circle of friends through mixed groups such as Fun Fridays, math groups, field trip groups, classroom seating and group arrangements.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Catalina Hernandez;skill_703=2;skill_704=2;skillspost=703,704,713,714,715,716,717,718;skill_713=2;skill_714=2;skill_715=2;skill_716=2;skill_717=2;skill_718=2;comments=<p>Although Max&nbsp;enjoys Spanish and has a great time expressing the language, he gets easily distracted and needs to put more effort into staying focused in class.</p>
<p>He&nbsp;has a great sense of humor and enjoys the stories we read and the songs we sing.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=1;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Nathaniel is a cheerful, friendly boy. He enters the classroom with energy and enthusiasm. Nathaniel participates during our group discussions and he will ask questions and give his comments remembering to use complete sentences in his responses.&nbsp;</p>
<p>Nathaniel sets out and begins his assignments, but at times he allows himself to get caught up in conversations and he needs to be redirected by a teacher.&nbsp;</p>
<p>Nathaniel is a resposible work team member and he willingly takes the initiative to help others if needed.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Tanner is a responsible work team member. He completes his job and will help other work team members if needed.&nbsp;</p>
<p>Tanner continues to work on getting a teacher right away if friendship issues occur. He is working on resolving conflicts using his words and expressing his feelings as well.</p>
<p>Tanner is a good friend in the classroom and he will participate during our group discussions. Tanner is working on making comments, asking questions and answering questions using complete sentences.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Willa is a sweet, kind and caring friend. She continues to work on having her voice heard during our group discussions. &nbsp;With encouragement, Willa will share her thoughts and ideas.</p>
<p>Willa is a responsible and conscientious work team member. She gets the job done and will also help others if needed.</p>
<p>We continue to help Willa expand her circle of friends through activities such as Fun Fridays, field trip groups, math groups, and Specialists classroom groups. &nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Zane is an out of the box thinker who brings us great questions and discoveries. He appropriately questions information that we are discussing and this helps us to explore topics in depth.</p>
<p>Zane has a great sense of humor and he is a kind and caring friend to his peers.</p>
<p>We continue to help Zane expand his circle of friends through activties such as Fun Fridays, field trip groups, math groups, classroom seating and Specialists group arrangements.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Stefanie Grutman, Jessica Collins, and Molly Kirkpatrick;skill_1083=2;skillspost=1083,1084,1085,1086,1087,1088,1089,1090,1091,1092,1093,1094,1095,1096,1097,1098,1099,1100,1101,1102,1103,1104,1105,1106,1107,1108,1109,1110,1111,1112,1113,1114,1115;skill_1084=2;skill_1085=4;skill_1086=2;skill_1087=2;skill_1088=2;skill_1089=2;skill_1090=2;skill_1091=2;skill_1092=4;skill_1093=2;skill_1094=4;skill_1095=2;skill_1096=10;skill_1097=4;skill_1098=4;skill_1099=2;skill_1100=4;skill_1101=4;skill_1102=2;skill_1103=4;skill_1104=4;skill_1105=4;skill_1106=4;skill_1107=4;skill_1108=2;skill_1109=4;skill_1110=4;skill_1111=5;skill_1112=5;skill_1113=2;skill_1114=2;skill_1115=2;comments=<p>It seems that Ariyah has difficulty organizing her thinking to give information or retell information in sequential order and in a cohesive manner.</p>
<p>We have seen some growth in Ariyah's reading. Her fluency has improved, however, she still tends to gloss over words that she doesn't know, and in its place, substitute a word that does not fit the context of the story. When reading with Ariyah, we use a variety of strategies to help her decode the unknown word, and therefore, comprehend what she's reading.</p>
<p>Ariyah's written language also has some of the same confusion as does her expressive language. Through writing conferences, we are helping Ariyah to organize her ideas using a webs and word list to clarify her thinking.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

