<p>Emily is a talented, creative writer who uses writing as an opportunity to explore her imaginative side. She works well independently and has a clear writing voice. She is learning to use her writing tools to add depth to her ideas. She diligently works through the Writer&rsquo;s Workshop process, eagerly accepting advice on her writing while improving her first draft. Emily loves to read, and never hesitates to pull out a silent reading book. She comes to each book group ready to participate as she has taken a significant amount of time ensuring she has done a thorough reading of the text.</p>;reader_notes=;notes=;status=0;submit=Save Section;

