teachers=Sarah Simon and Molly Kirpatrick;comments=<p>Bronte always comes to school with a good attitude, ready to learn. She is very sensitive of others' feelings and one child's challenge can impact her deeply.&nbsp;She&nbsp;has a an excellent sense of 'right and wrong' and sticks up for what she believes in. &nbsp;She&nbsp;always strives to do her best. &nbsp;She understands the importance of working in a team and does her best to make our classroom a safe and comfortable place to learn and share &nbsp;ideas.&nbsp;</p>
