teachers=Sarah Simon, Molly Kirkpatrick;comments=<p>Clara has a terrific sense of humor. When she is having fun, her joyfulness is contagious. She is incredibly creative and we see this creativity as an outlet and an anchor for her.&nbsp; She tends to put her own twist on class assignments so she can express herself the way she feels most comfortable.&nbsp; Her best work typically stems from project with a visual element to it.</p>
<p>We are helping Clara use strategies to stay on task with her classwork. She has difficulty hearing directions the first one or two times they are given. She often takes additional time to finish her assignments and then struggles to catch up to the group. &nbsp;We feel that this causes Clara to experience a disconnect with the curriculum and we are doing our best to support her in this.</p>
<p>In recent weeks, Clara often spends her Big Yard time alone and appears sad.&nbsp; She alludes to the fact that this stems from her lack of friends, but has not wanted to discuss it in full.&nbsp;We will continue to support and encourage her to reach out to new peers.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

