teachers=Carolyn Peralta, Kendra Elstad;skill_1082=2;skill_720=2;skill_721=2;skill_722=2;skill_724=2;skill_725=2;skill_726=2;skillspost=1082,720,721,722,724,725,726,729,730,1081,731,734,1080;skill_729=2;skill_730=2;skill_1081=2;skill_731=2;skill_734=2;skill_1080=2;comments=<p>Sammy is a naturally curious learner and is eager to ask questions about Los Angeles' complex history. &nbsp;Sammy successfully gathered new information about the different types of communities that exisist in Los Angeles through class discussions, readings, hands-on activities and a field trip. &nbsp;</p>
