teachers=Carolyn Peralta, Kendra Elstad;skill_1082=2;skill_720=2;skill_721=2;skill_722=2;skill_724=1;skill_725=2;skill_726=2;skillspost=1082,720,721,722,724,725,726,729,730,1081,731,734,1080;skill_729=2;skill_730=2;skill_1081=2;skill_731=2;skill_734=2;skill_1080=2;comments=<p>Angus is a naturally curious learner and seems genuinely interested in finding out more information about Los Angeles' complex history. Angus successfully gathered new information about the different types of communities that exisist in Los Angeles through class discussions, readings, hands-on activities and a field trip. &nbsp;</p>
<p>For his animal research project, Angus took ample notes about the Ancient Bison, and then translated those notes into a cohesive paragraph. &nbsp;He used his artistic talents to create his 'cereal box' and was thoughtful in preparing his maze and facts.</p>
<p>Currently, Angus is learning about the Tongva people who were the first inhabitants in Los Angeles. &nbsp;We look forward to particpating in Angus' continued growth in Los Angeles' history throughout the year.</p>;reader_notes=;notes=;status=1;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;skill_1082=2;skill_720=2;skill_721=2;skill_722=2;skill_724=2;skill_725=2;skill_726=2;skillspost=1082,720,721,722,724,725,726,729,730,1081,731,734,1080;skill_729=2;skill_730=2;skill_1081=2;skill_731=2;skill_734=2;skill_1080=2;comments=<p>Prescott participated in our social studies activities and field trips. We began our social studies unit with the four types of communities in the Los Angeles area: rural, suburban, urban and the cyber community. For our first trip we traveled to Lombardi Ranch to investigate and learn about the rural community. &nbsp;Along the way we observed the changing scenery from urban, to suburban and finally to our rural destination. &nbsp;Prescott worked with a group of his peers to create a diorama of the urban community. &nbsp;He was thoughtful in his work and he was a respectful group member in this project.</p>
<p>Prescott shared his thoughts, ideas and opinions during our social studies discussions. &nbsp;He was able to completed his class work and projects with teacher assistance. &nbsp;</p>
<p>Prescott chose to research the American Lion during our study of ancient Los Angeles. &nbsp;With teacher guidence, Prescott was able to find important information from reading materials and include the information in his research project. &nbsp;He also used his newfound information of the American Lion from our field trip to the Page Museum.</p>;reader_notes=;notes=;status=0;submit=Save Section;

