teachers=Roxanne Bergmans, Jody Poulos;skill_779=2;skill_780=2;skill_781=2;skill_782=2;skill_783=2;skill_784=2;skill_785=2;skillspost=779,780,781,782,783,784,785,1076,1078,1079,392,394,402,403,404,406;skill_1076=2;skill_1078=2;skill_1079=2;skill_392=2;skill_394=2;skill_402=2;skill_403=2;skill_404=2;skill_406=2;comments=<p>Angela has great math skills. &nbsp;She is not afraid to attempt new math concepts and she is more than willingly to share her strategies with her peers. &nbsp;We encourage Angela to clearly organize her work and begin alleviating braking numbers apart when solving double-digit and triple digit number problems. &nbsp;We would like to see Angela aligning her numbers as wholes and then solve. &nbsp;</p>
<p>Kayden demonstrated an understanding of solving single-digit by double-digit multiplication problems as well as double-digit by double-digit math problems using the Place Value Grid and the Place Value Square. &nbsp;We encourage Kayden to attempt the challenge problems with multi-steps and to seek teacher assistance if needed. &nbsp;This is a concept that is still challenging for Kayden even with teacher assistance.</p>
<p>Kayden is a responsible participant in math groups and turns in her homework on time. &nbsp;&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;skill_779=2;skill_780=4;skill_781=2;skill_782=4;skill_783=2;skill_784=2;skill_785=2;skillspost=779,780,781,782,783,784,785,1076,1078,1079,392,394,402,403,404,406;skill_1076=2;skill_1078=2;skill_1079=2;skill_392=4;skill_394=2;skill_402=2;skill_403=2;skill_404=2;skill_406=2;comments=<p>Derin is a mathematician. He has a good understanding of multiplication, but he needs to work on staying focused during group work. &nbsp;Derin enjoys sharing his strategies and thinking with his peers and willingly helps others in his math group. &nbsp;Derin needs to work on organizing his math work as he makes careless errors when his work is unorganized.&nbsp;</p>
<p>Derin demonstrated a clear understanding of solving single-digit by double-digit multiplication problems as well as double-digit by double-digit math problems using the Place Value Grid and the Place Value Square. &nbsp;Derin constantly challenged himself by trying and successfully solving multiplication problems with multi-steps and to choose appropriate number set. &nbsp;</p>
<p>Derin is a responsible participant in math groups and turns in his homework on time. &nbsp;He&nbsp;demonstrates a good understanding of the value of various coins and their combinations in making change. &nbsp;Derin organized his money project, The Enchanted Enchilada' and was able to add up money combinations, pay with a given amount and solve by counting up to give change back.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;skill_779=2;skill_780=2;skill_781=2;skill_782=2;skill_783=2;skill_784=2;skill_785=2;skillspost=779,780,781,782,783,784,785,1076,1078,1079,392,394,402,403,404,406;skill_1076=2;skill_1078=2;skill_1079=2;skill_392=2;skill_394=2;skill_402=2;skill_403=2;skill_404=2;skill_406=2;comments=<p>Prescott has great math skills. &nbsp;With clarification, he will attempt new math concepts and he willingly shares his strategies with his peers as long as he is absolutely sure he has the correct answer. &nbsp;In addition, Prescott needs to work on aligning his numbers properly and then solve. &nbsp;</p>
<p>Prescott demonstrated a clear understanding of solving single-digit by double-digit multiplication problems as well as double-digit by double-digit math problems using the Place Value Grid and the Place Value Square.&nbsp;Prescott challenges himself with the mutli-step multiplication problems, but he needs to break down the problem so he has a better understanding of what is being asked so he can successfully solve these challenging problems without teacher assistance.</p>
<p>Prescott is a responsible participant in math groups and turns in his homework on time. &nbsp;He&nbsp;demonstrates a good understanding of the value of various coins and their combinations in making change. &nbsp;Prescott organized his money project, The Enchanted Enchilada' and was able to add up money combinations, pay with a given amount and solve by counting up to give change back with teacher assistance.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;skill_779=2;skill_780=2;skill_781=2;skill_782=2;skill_783=2;skill_784=2;skill_785=2;skillspost=779,780,781,782,783,784,785,1076,1078,1079,392,394,402,403,404,406;skill_1076=2;skill_1078=2;skill_1079=2;skill_392=2;skill_394=2;skill_402=2;skill_403=2;skill_404=2;skill_406=2;comments=<p>Reid is a mathematician. He has a good understanding of multiplication, but he needs to work on staying focused during group work. &nbsp;Reid enjoys sharing his strategies and thinking with his peers and willingly helps others in his math group. &nbsp;</p>
<p>Reid demonstrated a clear understanding of solving single-digit by double-digit multiplication problems as well as double-digit by double-digit math problems using the Place Value Grid and the Place Value Square. &nbsp;Reid should continue to practice his multiplication facts to help solidify this skill. &nbsp;He constantly challenged himself by trying to &nbsp;solve multiplication problems with multi-steps. These math problems were challenging for Reid. It would help him to break the problem down and solve one step at a time.</p>
