teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Alex is a kind and caring friend to her peers. &nbsp;At various times Alex will particpate in our group discussions and when she does she speaks in a small and quiet voice. She is working on projecting her voice so her great thoughts, comments, and ideas are heard by all. &nbsp;As a class, we are strengthening our speaking skills by asking and answering questions using complete sentences.&nbsp;</p>
<p>Alex can be distracted by her friends through private conversations, but with teacher reminders she is able to redirtect her attention to the task at hand and refocus to complete her work in a timely manner.</p>
<p>Alex is a responsible work team participant. She completes her work team responsibilities and will often offer to help others with their jobs. Alex will take the initiative and do the work of a friend who is absent.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Angela is a respectful friend with a great sense of humor. &nbsp;She eagerly participates in our group discussions and sets good examples for her peers. &nbsp;Angela is a responsible student and she uses her time well in the classroom. &nbsp;We enjoy Angela's enthusiasm for learning and her light-hearted humor she brings to our classroom.</p>
<p>Angela is a responsible work team participant. &nbsp;She completes her work team responsibilities and will often offer to help others with their jobs. &nbsp;Angela will take the initiative and do the work of a friend who is absent.</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Ethan has a great sense of humor and he is a person who thinks outside of the box. He is a good friend to his peers and he is always willing to help either his teachers or his peers.&nbsp;</p>
<p>Ethan participates during our group discussions and he is working on making comments and asking and answering questions using complete sentences during our morning shares. &nbsp;There are times during our group discussion when Ethan needs to be reminded to not chat with friends. He is easily redirected by his teachers and he is able to focus on our discussion at hand.&nbsp;</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Linus is a kind, caring and friendly boy. &nbsp;He is respectful to both his teachers and peers. &nbsp;Linus is a great buddy to students who come to visit Wildwood. &nbsp;He guides them through the day and he makes sure to include them in activities.</p>
<p>Linus participates during our group discussions and he is working on making comments, asking questions and answering questions using complete sentences.&nbsp;</p>
<p>We are helping Linus expand his circle of friends through mixed groups such as Fun Fridays, math groups, field trip groups, classroom seating and group arrangements.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Nathaniel is a cheerful, friendly boy. &nbsp;He enters the classroom with energy and enthusiasm. &nbsp;Nathaniel participates during our group discussions and he will ask questions and give his comments remembering to use complete sentences in his responses.&nbsp;</p>
<p>Nathaniel sets out and begins his assignments, but at times he allows himself to get caught up in conversations and he needs to be redirected by a teacher.&nbsp;</p>
<p>Nathaniel is a resposible work team member and he willingly takes the initiative to help others if needed.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Prescott is sweet and kind to both his classmates and teachers. &nbsp;He will participate is our group discussions when he feels safe and is able to give what he thinks is the 'right' answer.</p>
<p>Prescott continues to work on his anxiety outburts. &nbsp;Prescott will usually quickly respond to being redirected when a caring firm voice is used by his teachers. &nbsp;It is difficult for Prescott to try something new as he feels that he needs to be good at or know everything and he feels that mistakes are not allowed. &nbsp;When the outcome of a game, or activity does not go the way Prescott thinks it should, he becomes frustrated, angry and upset.</p>
<p>Prescott is a responsible work team member and he takes his jobs seriously. &nbsp;He is willing to help others, or fill-in for those who may be absent.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;comments=<p>Tanner is a responsible work team member. He completes his job and will help other work team members if needed.&nbsp;</p>
<p>Tanner continues to work on getting a teacher right away if friendship issues occur. &nbsp;He is working on resolving conflicts using his words and expressing his feelings as well.</p>
<p>Tanner is a good friend in the classroom and he will participate during our group discussions. &nbsp;Tanner is working on making comments, asking questions and answering questions using complete sentences. &nbsp;At times Tanner is distracted by private conversations and needs to be reminded to stay focused on our discussions.</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Roxanne Bergmans, Jody Poulos;skill_786=2;skill_787=2;skill_788=2;skill_789=2;skill_790=2;skill_791=2;skill_792=2;skillspost=786,787,788,789,790,791,792,961,962,1074,964,1075,967,968,969,970,971,978,979,973,974,977,980,981,982,983,984,985,986,987,988,989,990,991,994;skill_961=4;skill_962=4;skill_1074=2;skill_964=2;skill_1075=2;skill_967=4;skill_968=4;skill_969=2;skill_970=2;skill_971=2;skill_978=2;skill_979=2;skill_973=2;skill_974=2;skill_977=2;skill_980=2;skill_981=2;skill_982=2;skill_983=2;skill_984=2;skill_985=2;skill_986=2;skill_987=2;skill_988=2;skill_989=2;skill_990=2;skill_991=2;skill_994=2;comments=<p>Chloe enjoys creating stories from personal experiences such as family celebrations, travels, or adventures. &nbsp;This was evident in her personal narrative about her travels to Idaho this past summer with her family. &nbsp;She was able to add details to help paint a picture for her readers. &nbsp;At times, Chloe needs extra thinking time to decide on topic for her writing assignments. &nbsp;However, she is conscientious about self-editing her work &nbsp;before seeking a teacher's final editing.</p>
<p>Chloe learned how to implement her 'Thinking While Reading' skills: prediction, visualization and connections at the beginning of the school year. &nbsp;She was also introduced to the concept of character traits, contextual clues, and how to retell a story. &nbsp;Chloe continues to practice these reading skills during our class Read Aloud,&nbsp;<span style='text-decoration: underline;'><strong>Theodosia and the Serpents o</strong><strong>f Chaos</strong></span>, by R.L. LaFevers.&nbsp;</p>
<p>Chloe is currently reading,&nbsp;<strong><span style='text-decoration: underline;'>Emily Windsnap and the Siren's</span></strong><span style='text-decoration: underline;'>&nbsp;<strong>Secret</strong>,</span> by Liz Kessler.;reader_notes=;notes=;status=0;submit=Save Section;

