teachers=Sarah Simon and Molly Kirkpatrick;comments=<p>Bronte always comes to school with a good attitude, ready to learn. She is very sensitive of others' feelings and one child's challenge can impact her deeply.&nbsp;She&nbsp;has a an excellent sense of 'right and wrong' and sticks up for what she believes in. &nbsp;She&nbsp;always strives to do her best. &nbsp;She understands the importance of working in a team and does her best to make our classroom a safe and comfortable place to learn and share &nbsp;ideas.&nbsp;</p>
<p>Although it's still a work in progress, Bronte has been using her 'big voice' in class, and we've seen an improvement in this area. We are still working on helping her communicate with this voice in a group setting without having to be reminded.&nbsp;</p>
<p>&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Sarah Simon and Molly Kirkpatrick;skill_794=2;skill_795=2;skill_798=2;skill_796=2;skill_797=2;skillspost=794,795,798,796,797,800,898,907,909,910,801,893,895,912,913,914,911,915,916,917,918,919;skill_800=2;skill_898=2;skill_907=2;skill_909=2;skill_910=2;skill_801=2;skill_893=2;skill_895=2;skill_912=2;skill_913=2;skill_914=2;skill_911=2;skill_915=2;skill_916=2;skill_917=2;skill_918=2;skill_919=2;comments=<p>Molly Notes:&nbsp;</p>
<p>Canaan thrives when he is asked to think outside of the box. If he is given an open-ended assignment like a Venn Diagram, where is asked to compare and contrast something, his ideas are endless. He makes connections between himself and his culture and other people/characters and theirs.&nbsp;</p>
<p>Canaan takes great care with his Social Studies work. He asks thoughtful questions that provoke deeper discussion. He thinks before he writes, and he has a vision before he begins. (Anna stuff, Native American stuff, Systems stuff)</p>;reader_notes=;notes=;status=0;submit=Save Section;

