teachers=Sarah Simon and Molly Kirkpatrick;skill_794=2;skill_795=2;skill_798=2;skill_796=2;skill_797=2;skillspost=794,795,798,796,797,800,898,907,909,910,801,893,895,912,913,914,911,915,916,917,918,919;skill_800=2;skill_898=2;skill_907=2;skill_909=2;skill_910=2;skill_801=2;skill_893=2;skill_895=2;skill_912=2;skill_913=2;skill_914=2;skill_911=2;skill_915=2;skill_916=2;skill_917=2;skill_918=2;skill_919=2;comments=<p>Molly Notes:&nbsp;</p>
<p>- Donny brings a unique and worldly perspective to our class social studies conversations. He is always enthusiastic to share his own culture and family traditions and does so with thoughtful and expressive language. &nbsp;</p>
<p>- When discussing systems, Donny thinks deeply and creatively. He likes to bring advanced topics to the circle such as global warming and evolution, and ties these topics into our systems discussions about water, community, and food. (etc)</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Sarah Simon and Molly Kirkpatrick;skill_794=2;skill_795=2;skill_798=2;skill_796=2;skill_797=2;skillspost=794,795,798,796,797,800,898,907,909,910,801,893,895,912,913,914,911,915,916,917,918,919;skill_800=2;skill_898=2;skill_907=2;skill_909=2;skill_910=2;skill_801=2;skill_893=2;skill_895=2;skill_912=2;skill_913=2;skill_914=2;skill_911=2;skill_915=2;skill_916=2;skill_917=2;skill_918=2;skill_919=2;comments=<p>Molly Notes:&nbsp;</p>
<p>- In social studies group projects or assignments (such as collecting data about water sources around Wildwood and exploring how water systems help our community) Emma comfortably fits into the leadership role and can easily expresses herself in group settings.&nbsp;</p>
<p>-Emma respectfully listens in class to read aloud and group discussions about other cultures and communities and later makes connections about other cultures and her own. She expresses these ideas through her journaling and classwork.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

teachers=Sarah Simon and Molly Kirkpatrick;comments=<p>Molly Notes:&nbsp;</p>
<p>- Emma is enthusiastic to learn. She always comes to school on time and puts forth excellent effort. Emma is working on gaining confidence in her work so that she does not need constant teacher approval to move on to the next task.&nbsp;</p>
<p>- Socially- Emma has set many goals for herself over the past few months in order to keep peace within her interactions with others. She has done an excellent job attempting to keep away from unhealthy relationships with peers. She has successfully explored other friendships and has used her 'i messages' to communicate when conflicts arise. With that said, this is still a work in progress. We are helping Emma navigate through these situations. We are also helping Emma understand the concept of 'leaving it at the door' (an idea that helps second graders shift their focus away from social unrest when it is learning time).</p>;reader_notes=;notes=;status=0;submit=Save Section;

