<p>- When learning about other people and cultures, Ethan looks at the 'big picture' and can efficiently articulate his thoughts to his classmates by shedding light on an angle they might not have thought of. This aides in his understanding of how the world works, and helps him view situations through others' perspectives too.&nbsp;</p>;reader_notes=;notes=;status=0;submit=Save Section;

